package net.jetmq.broker

import akka.actor.{ActorSystem, Props}
import akka.testkit.{ImplicitSender, TestKit}
import net.jetmq.Helpers._
import org.specs2.mutable._
import org.specs2.specification.Scope

class Scenario10Spec extends TestKit(ActorSystem()) with ImplicitSender with SpecificationLike with Scope {

  sequential //slower, but in order (tests can be state dependant)
  //isolated //faster, but without order

  "Scenario 10" should {

    def create_actor() = {
      val bus = system.actorOf(Props[EventBusActor])
      system.actorOf(Props(new RequestsHandler(bus)))
    }

    "Scenario #50829" in {
      val h = create_actor

      h ! "100c00044d515454040200000000".toTcpReceived //CONNECT
      expectMsg("20020000".toTcpWrite) //CONNACK

      h ! "e000".toTcpReceived //DISCONNECT
      expectNoMsg()
      success
    }

    "Scenario #50830" in {
      val h = create_actor

      h ! "101200044d5154540402000000066e6f726d616c".toTcpReceived //CONNECT
      expectMsg("20020000".toTcpWrite) //CONNACK

      h ! "e000".toTcpReceived //DISCONNECT
      expectNoMsg()
      success
    }

    "Scenario #50831" in {
      val h = create_actor

      h ! "102300044d5154540402000000173233206368617261637465727334353637383930313233".toTcpReceived //CONNECT
      expectMsg("20020000".toTcpWrite) //CONNACK

      h ! "e000".toTcpReceived //DISCONNECT
      expectNoMsg()
      success
    }

    "Scenario #50832" in {
      val h = create_actor

      h ! "103500044d5154540402000000294120636c69656e746964207468617420697320746f6f206c6f6e67202d2073686f756c64206661696c".toTcpReceived //CONNECT
      expectMsg("20020000".toTcpWrite) //CONNACK

      h ! "e000".toTcpReceived //DISCONNECT
      expectNoMsg()
